import {footer_menu} from "./data";
function Footer() {
    const uls = footer_menu.map(ul => {
        const lis = ul.list.map(item => {
            (<li className="footer-list__item" key={item}>
                <a className="footer-list__link">{item}</a>
            </li>)
        });
        return (
            <ul className="footer-list">
                {lis}
            </ul>
        )
    });
    return (
        <footer className="footer">
            {uls}
        </footer>
    );
}
export default Footer;
